import React from 'react'
import Header from '../Header/Header'
import Footer from '../Footer/Footer'
import { useParams } from "react-router-dom";

const Proyecto = () =>{

    const {name} = useParams();

    return(
    <div>
        <Header/>

         <h2>{name}</h2>   
        
    </div>
    )
}

export default Proyecto
